import React from "react";
import { Link } from "react-router-dom";

export default function TeamComp({ teams }) {
  console.log(teams);

  return (
    <div>
      {teams.map((team, i) => {
        <>
          <Link to={`/teams/${team.name}`}>
            <p key={i}>{team.name}</p>;
          </Link>
          ;
        </>;
      })}
    </div>
  );
}
